// HomeServ.js
import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const HomeServ = () => {
  // You can replace this with the actual logo image file
  const logo = require('/assets/logo.png');

  // Array of names of the people who invented the app
  const inventors = [
    'Inventor 1',
    'Inventor 2',
    'Inventor 3',
    'Inventor 4',
    'Inventor 5',
    'Inventor 6',
  ];

  return (
    <View style={styles.container}>
      <Image source={logo} style={styles.logo} />
      <Text style={styles.text}>About Page</Text>

      {/* Display the names of the inventors */}
      <View style={styles.inventorsContainer}>
        {inventors.map((inventor, index) => (
          <Text key={index} style={styles.inventorText}>
            {inventor}
          </Text>
        ))}
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  logo: {
    width: 100, // Adjust the width as needed
    height: 100, // Adjust the height as needed
    marginBottom: 20,
  },
  text: {
    fontSize: 20,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  inventorsContainer: {
    marginTop: 10,
  },
  inventorText: {
    fontSize: 16,
    marginBottom: 5,
  },
});

export default HomeServ;
